        const fetchUserData = async () => {
            try {
                const response = await fetch(`http://localhost:5500/info?username=${props.user}`);
                if (!response.ok) {
                    throw new Error('Failed to fetch user data');
                }
                const data = await response.json();
                setName(data.name);
                setEmail(data.email);
                setPath1(data.path1 || []);
                setPath2(data.path2 || []);
            } catch (error) {
                console.error('Error fetching user data:', error);
            }
        };
        fetchUserData();
        document.body.style.backgroundColor = props.mode === "light" ? "#f7f7f7" : "#333";
    }, [props.user, props.mode]);

    const handleDelete = async () => {
        try {
            const response = await fetch(`http://localhost:5500/delete?username=${props.user}`, {
                method: "DELETE"
            })
            if (response.ok) {
                props.loggedout();
                console.log("Account Successfully Deleted");
            }
        }
        catch (error) {
            console.log("Error Deleting an Account", error);
        }
    }

    return (
        <div className="container mt-5">
            <div className="row">
                <div className="col-md-3">
                    <div className="card">
                        <div className="card-body">
                            <h5 className="card-title">{name.toUpperCase()}</h5>
                            <button className='btn btn-dark' onClick={props.loggedout} style={{ backgroundColor: "#FFA07A", color: "#242424", borderColor: "white" }}>LogOut</button>
                            <button className='btn btn-dark ms-2' onClick={handleDelete} style={{ backgroundColor: "#FFA07A", color: "#242424", borderColor: "white" }}>Delete Account</button>
                        </div>
                    </div>
                </div>
                <div className="col-md-9">
                    <div className="card">
                        <div className="card-body">
                            <h5 className="card-title">Profile Information</h5>
                            <ul className="list-group list-group-flush">
                                <li className="list-group-item"><strong>Name:</strong> {name}</li>
                                <li className="list-group-item"><strong>Email:</strong> {email}</li>
                            </ul>
                        </div>
                    </div>
                    <div className="card mt-3">
                        <div className="card-body">
                            <h5 className="card-title">Activities</h5>
                            <div id="accordion">
                                <div className="accordion-item">
                                    <h2 className="accordion-header">
                                        <button className="accordion-button" type="button" data-bs-toggle="collapse" data-bs-target="#collapseOne">
                                            StyleTransfer Activity
                                        </button>
                                    </h2>
                                    <div id="collapseOne" className="accordion-collapse collapse">
                                        <div className="accordion-body">
                                            <div className="row row-cols-1 row-cols-md-3 g-4">
                                                {path1.map((path, index) => (
                                                    <div className="col" key={index}>
                                                        <div className="card h-100">
                                                            <img src={`http://localhost:5500/${path}`} className="card-img-top" alt="" />
                                                        </div>
                                                    </div>
                                                ))}
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                <div className="accordion-item">
                                    <h2 className="accordion-header">
                                        <button className="accordion-button collapsed" type="button" data-bs-toggle="collapse" data-bs-target="#collapseTwo">
                                            DeepDream Activity
                                        </button>
                                    </h2>
                                    <div id="collapseTwo" className="accordion-collapse collapse">
                                        <div className="accordion-body">
                                            <div className="row row-cols-1 row-cols-md-3 g-4">
                                                {path2.map((path, index) => (
                                                    <div className="col" key={index}>
                                                        <div className="card h-100">
                                                            <img src={`http://localhost:5500/${path}`} className="card-img-top" alt="" />
                                                        </div>
                                                    </div>
                                                ))}
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}
